script: |
  super -f text -I q7116.spq | sort > q7116.out

inputs:
  - name: q7116.spq
    data: |
      SELECT DISTINCT + 35 FROM tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab0 (FORMAT parquet) cor1, tab0 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q7116.out
    data: |
      35
